import{_ as e,o as a,c as s,Q as t}from"./chunks/framework.6d94f49f.js";const g=JSON.parse('{"title":"Spotify Premium - PC/Móvil","description":"","frontmatter":{},"headers":[],"relativePath":"Tutoriales/spotify-premium.md","filePath":"Tutoriales/spotify-premium.md"}'),i={name:"Tutoriales/spotify-premium.md"},o=t('<p><img src="https://i.postimg.cc/MHTbrWpN/Spotify.png" alt=""></p><h1 id="spotify-premium-pc-movil" tabindex="-1">Spotify Premium - PC/Móvil <a class="header-anchor" href="#spotify-premium-pc-movil" aria-label="Permalink to &quot;Spotify Premium - PC/Móvil&quot;">​</a></h1><p>Descarga y obten las funciones premium de Spotify en cualquier dispositivo en la lista.</p><hr><h2 id="para-windows-mac-linux" tabindex="-1">Para Windows/Mac/Linux <a class="header-anchor" href="#para-windows-mac-linux" aria-label="Permalink to &quot;Para Windows/Mac/Linux&quot;">​</a></h2><p><img src="https://i.postimg.cc/m2GJBbqf/asasasas.png" alt=""></p><p>Para conseguir la aplicacion con funciones premium en escritorio debemos seguir los sieguientes pasos:</p><blockquote><p>Esto no te permitira descargar las canciones, ten eso en cuenta.</p></blockquote><ol><li><p>Descargamos el Spotify oficial desde aqui: <a href="https://www.spotify.com/us/download/" target="_blank" rel="noreferrer">!badge variant=&quot;success&quot; text=&quot;Descargalo aqui!&quot;</a></p></li><li><p>Instalamos el spotify e iniciamos sesion con nuestra cuenta.</p></li><li><p>Ahora cerramos el spotify y nos aseguramos que no quede ejecutandose en segundo plano.</p></li></ol><p><strong>Ahora, tienes dos opciones para el premium</strong></p><p>==- SpotX - Activa las funciones premium</p><p>+++ Windows</p><p>. Descargamos el Script para desbloquear las funciones premium y la nueva interfaz. <a href="https://raw.githack.com/amd64fox/SpotX/main/scripts/Install_Auto.bat" target="_blank" rel="noreferrer">!badge variant=&quot;success&quot; text=&quot;Descargalo aqui!&quot;</a></p><ol start="5"><li>Ejecuta el script como administrador y listo, eso es todo. Ya puedes abrir spotify y estara premium.</li></ol><blockquote><p>Si quieres desinstalar el mod usa <a href="https://raw.githack.com/amd64fox/SpotX/main/Uninstall.bat" target="_blank" rel="noreferrer">el desisntalador</a></p></blockquote><p>+++ Mac y linux</p><ol><li>Abre la terminar y ejecuta el siguiente comando:</li></ol><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#e1e4e8;">bash &lt;(curl -sSL https://gist.github.com/jetfir3/e8830cf8deba6a4f15eec094d344f7b1/raw/spotx.sh)</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#24292e;">bash &lt;(curl -sSL https://gist.github.com/jetfir3/e8830cf8deba6a4f15eec094d344f7b1/raw/spotx.sh)</span></span></code></pre></div><p>+++</p><p>==- Spicetify - Activa premium, temas, extensiones, y mas.</p><ol><li>Ejecuta lo siguiente desde la terminal de tu equipo (powershell &amp; Terminal en MAC &amp; Linux)</li></ol><p>+++ Windows</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#e1e4e8;">iwr -useb https://raw.githubusercontent.com/spicetify/spicetify-cli/master/install.ps1 | iex</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#24292e;">iwr -useb https://raw.githubusercontent.com/spicetify/spicetify-cli/master/install.ps1 | iex</span></span></code></pre></div><hr><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#e1e4e8;">iwr -useb https://raw.githubusercontent.com/spicetify/spicetify-marketplace/main/resources/install.ps1 | iex</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#24292e;">iwr -useb https://raw.githubusercontent.com/spicetify/spicetify-marketplace/main/resources/install.ps1 | iex</span></span></code></pre></div><p>+++ Mac &amp;Linux</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#e1e4e8;">curl -fsSL https://raw.githubusercontent.com/spicetify/spicetify-cli/master/install.sh | sh</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#24292e;">curl -fsSL https://raw.githubusercontent.com/spicetify/spicetify-cli/master/install.sh | sh</span></span></code></pre></div><hr><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#e1e4e8;">curl -fsSL https://raw.githubusercontent.com/spicetify/spicetify-marketplace/main/resources/install.sh | sh</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#24292e;">curl -fsSL https://raw.githubusercontent.com/spicetify/spicetify-marketplace/main/resources/install.sh | sh</span></span></code></pre></div><p>+++</p><ol start="2"><li><p>Eso es todo, en caso que nada cambie, intenta escribiendo <code>spicetify apply</code> en la terminal y dando enter.</p></li><li><p>Abre spotify y en la nueva pestaña de marketplace, selecciona la extension de &quot;adblock&quot; para quitar los anuncios.</p></li><li><p>Puedes instalar mas extensiones, temas y etc.</p></li><li><p>Disfruta.</p></li></ol><p>===</p><h2 id="para-android" tabindex="-1">Para Android <a class="header-anchor" href="#para-android" aria-label="Permalink to &quot;Para Android&quot;">​</a></h2><p>Para conseguir la version mas reciente y segura de Spotify mod en android, necesitaremos instalar un Manager. Esta es una aplicacion que permitira instalar una version segura de spotify mod.</p><blockquote><p>Recuerda que estas versiones no permiten las descargas de canciones, el resto de funciones premium estan disponibles.</p></blockquote><p>Pasos:</p><ol><li>Descargamos el XManager y lo instalamos en nuestro celular. <a href="https://github.com/xManager-App/xManager/releases/latest/download/xManager.apk" target="_blank" rel="noreferrer">!badge variant=&quot;success&quot; text=&quot;Descargalo aqui!&quot;</a></li></ol><blockquote><p>Esta aplicacion es completamente segura, <a href="https://www.virustotal.com/gui/file/994ea1d7b7cea1ab7f9ffb18b24ea8f58cd9d511ac8c5dc967d47207c55fa891/detection" target="_blank" rel="noreferrer">aqui puedes ver el analisis de virus total</a>.</p></blockquote><ol start="2"><li>Al abrir damos los permisos requeridos e instalamos cualquiera de las versiones siguientes.</li></ol><p><img src="https://static.wixstatic.com/media/01dd63_fb36d3ac01a44b1b90043e04e17f823f~mv2.png/v1/fill/w_336,h_658,al_c,q_85,usm_0.66_1.00_0.01,enc_auto/edited_1.png" alt="opciones"></p><p>Puedes seleccionar:</p><ul><li><strong>Stock patched / Version regular parchada:</strong> Esta es la version normal pero con las funciones premium.</li><li><strong>Amoled Patched / Version Amoled parchada:</strong> Esta es la version completamente oscura/negra con las funciones premium.</li><li><strong>Lite Patched / Version Mini parchada:</strong> Esta es la version lite o mini de Spotify con premium.</li></ul><ol start="3"><li><p>Escoque la version mas reciente y si esa te da error, escoge una anterior.</p></li><li><p>Eso es todo. Con eso tendras spotify premium.</p></li></ol><hr><h2 id="para-ios" tabindex="-1">Para iOS <a class="header-anchor" href="#para-ios" aria-label="Permalink to &quot;Para iOS&quot;">​</a></h2><p>Para iOS se debe hacer con sideloading. Si no sabes que es eso, recomiendo ver un video en youtube o tutorial en la web (pronto hare uno yo).</p><p>Puedes descargar estas versiones mod premium:</p><ul><li><a href="https://appdb.to/app/cydia/1900000540" target="_blank" rel="noreferrer">!badge variant=&quot;success&quot; target=&quot;blank&quot; text=&quot;Spotify ++&quot;</a></li><li><a href="https://files.ipaspot.app/spotify++.ipa" target="_blank" rel="noreferrer">!badge variant=&quot;success&quot; target=&quot;blank&quot; text=&quot;Enlace alternativo&quot;</a></li></ul><hr><blockquote><p><strong>¿Tienes una petición o duda durante el tutorial?</strong><br><em>Hazlo desde</em> <a href="https://discord.gg/hVKeY3uEru" target="_blank" rel="noreferrer">!badge variant=&quot;contrast&quot; icon=&quot;feed-rocket&quot; text=&quot;Discord&quot;</a></p></blockquote>',50),r=[o];function l(n,p,c,u,d,m){return a(),s("div",null,r)}const f=e(i,[["render",l]]);export{g as __pageData,f as default};
